import React from 'react';
import Typography from '@mui/material/Typography';

export default function Create() {
  return (
    <>
            <form novalidate autoComplete="off">
                <TextField />
            </form>        
        <Typography color="textSecondary" variant = "h6" component="h2" gutterBottom>
          Notes page
        </Typography>
    </>

  )
}
